window.addEventListener('error', function (evt) {
  if (!evt.target) return;

  var src;
  if (evt.target.tagName == 'SCRIPT' && evt.target.src) {
    src = evt.target.src;
  } else if (evt.target.tagName == 'LINK' && evt.target.rel == 'stylesheet') {
    src = evt.target.href;
  } else {
    return;
  }

  var img = new Image();
  img.src = '/paper/ep/internal/api/errors' +
    '?random=' + Math.random() +
    '&context=' + encodeURIComponent(navigator.userAgent) +
    '&message=' + encodeURIComponent("Error loading " + evt.target.tagName.toLowerCase() + ": " + src) +
    '&extraData=' + encodeURIComponent(JSON.stringify({src: src})) +
    '&url=' + encodeURIComponent(window.location.href) +
    '&isLegacyError=true';
}, true /* useCapture */);

var _pageLoadOnErrorFired = false;
window.onerror = function(message, file, line, column, error, isNonPaging) {
  if (_pageLoadOnErrorFired) return;
  _pageLoadOnErrorFired = true;

  var img = new Image();
  img.src = '/paper/ep/internal/api/errors' +
      '?random=' + Math.random() +
      '&context=' + encodeURIComponent(navigator.userAgent) +
      '&message=' + encodeURIComponent(message) +
      '&file=' + encodeURIComponent(file || '') +
      '&line=' + encodeURIComponent(line == undefined ? line : '') +
      '&column=' + encodeURIComponent(column == undefined ? column : '') +
      '&isLegacyError=' + encodeURIComponent(isNonPaging ? 'true' : '') +
      '&url=' + encodeURIComponent(window.location.href);
};

var preInitPerf = {
  data: {},
  mark: function(tickName, timestamp) {
    if (typeof timestamp === 'number') {
      preInitPerf['data'][tickName] = timestamp;
    } else {
      if (console['timeStamp']) { console['timeStamp'](tickName); }
      preInitPerf['data'][tickName] = Date.now();
    }
  }
}

// TODO: remove this once the new CSI instrumentation is stable
var csi = {
  data: { tick: {} },
  tick: function(tick, time) {
    csi['data'].tick[tick] = time || Date.now();
  },
  start: function(time) {
    csi['data'] = { tick: {} };
    csi.tick('start', time);
  }
};

(function(w, d) {
  csi.perf = w.performance || w.mozPerformance || w.msPerformance || w.webkitPerformance;
  csi.start(csi.perf && csi.perf.timing ? csi.perf.timing.responseStart : null);
})(window, document);

var streamingClientContextPath = '/paper/comet';
var streamingClientAcceptableChannelTypes = ['shortpolling', 'streaming'];
var streamingClientCanUseSubDomains = true;
var streamingClientCanUseCollabService = true

if (window.initializeComposer) {
  typeof preInitPerf !== 'undefined' && preInitPerf.mark('before-initializeComposer()');
  window.initializeComposer();
  typeof preInitPerf !== 'undefined' && preInitPerf.mark('after-initializeComposer()');
}

if (!window.dropbox) {
  window.dropbox = {};
}
window.dropbox.privacyConsent = {
  autoInit: {
    injectToFooter: false,
    injectFloatingButton: false,
    disableBanner: false,
    thirdPartyConfig: {cookieDomain: 'dropbox.com'},
  },
};

styles:
html {color:#1e1919; background-color: #fff;}
@media not print {
  html.paper-dig-dark {color:#f7f5f2; background-color: #161313;}
}

@-webkit-keyframes rotate {
  from  { -webkit-transform: rotate(0deg); }
  to   { -webkit-transform: rotate(360deg); }
}

@keyframes rotate {
  from  { transform: rotate(0deg); }
  to   { transform: rotate(360deg); }
}

  .dropbox-dropin-btn, .dropbox-dropin-btn:link, .dropbox-dropin-btn:hover {
    display: inline-block;
    height: 14px;
    font-family: "Lucida Grande", "Segoe UI", "Tahoma", "Helvetica Neue", "Helvetica", sans-serif;
    font-size: 11px;
    font-weight: 600;
    color: #636363;
    text-decoration: none;
    padding: 1px 7px 5px 3px;
    border: 1px solid #ebebeb;
    border-radius: 2px;
    border-bottom-color: #d4d4d4;
      background: #fcfcfc;
background: -moz-linear-gradient(top, #fcfcfc 0%, #f5f5f5 100%);
background: -webkit-linear-gradient(top, #fcfcfc 0%, #f5f5f5 100%);
background: linear-gradient(to bottom, #fcfcfc 0%, #f5f5f5 100%);
filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#fcfcfc', endColorstr='#f5f5f5',GradientType=0);  
  }

  .dropbox-dropin-default:hover, .dropbox-dropin-error:hover {
    border-color: #dedede;
    border-bottom-color: #cacaca;
      background: #fdfdfd;
background: -moz-linear-gradient(top, #fdfdfd 0%, #f5f5f5 100%);
background: -webkit-linear-gradient(top, #fdfdfd 0%, #f5f5f5 100%);
background: linear-gradient(to bottom, #fdfdfd 0%, #f5f5f5 100%);
filter: progid:DXImageTransform.Microsoft.gradient(startColorstr='#fdfdfd', endColorstr='#f5f5f5',GradientType=0);  
  }

  .dropbox-dropin-default:active, .dropbox-dropin-error:active {
    border-color: #d1d1d1;
    box-shadow: inset 0 1px 1px rgba(0,0,0,0.1);
  }

  .dropbox-dropin-btn .dropin-btn-status {
    display: inline-block;
    width: 15px;
    height: 14px;
    vertical-align: bottom;
    margin: 0 5px 0 2px;
    background: transparent url('https://www.dropbox.com/static/metaserver/static/images/widgets/dbx-saver-status.png') no-repeat;
    position: relative;
    top: 2px;
  }

  .dropbox-dropin-default .dropin-btn-status {
    background-position: 0px 0px;
  }

  .dropbox-dropin-progress .dropin-btn-status {
    width: 18px;
    margin: 0 4px 0 0;
    background: url('https://www.dropbox.com/static/metaserver/static/images/widgets/dbx-progress.png') no-repeat center center;
      -webkit-animation-name: rotate;
      -webkit-animation-duration: 1.7s;
      -webkit-animation-iteration-count: infinite;
      -webkit-animation-timing-function: linear;
    animation-name: rotate;
    animation-duration: 1.7s;
    animation-iteration-count: infinite;
    animation-timing-function: linear;
  }

  .dropbox-dropin-success .dropin-btn-status {
    background-position: -15px 0px;
  }

  .dropbox-dropin-disabled {
    background: #e0e0e0;
    border: 1px #dadada solid;
    border-bottom: 1px solid #ccc;
    box-shadow: none;
  }

  .dropbox-dropin-disabled .dropin-btn-status {
    background-position: -30px 0px;
  }

  .dropbox-dropin-error .dropin-btn-status {
    background-position: -45px 0px;
  }

@media only screen and (-webkit-min-device-pixel-ratio: 1.4) {
    .dropbox-dropin-btn .dropin-btn-status {
      background-image: url('https://www.dropbox.com/static/metaserver/static/images/widgets/dbx-saver-status-2x.png');
      background-size: 60px 14px;
        -webkit-background-size: 60px 14px;
    }

    .dropbox-dropin-progress .dropin-btn-status {
      background: url('https://www.dropbox.com/static/metaserver/static/images/widgets/dbx-progress-2x.png') no-repeat center center;
      background-size: 20px 20px;
        -webkit-background-size: 20px 20px;
    }
}

  .dropbox-saver:hover, .dropbox-chooser:hover {
    text-decoration: none;
    cursor: pointer;
  }

  .dropbox-chooser, .dropbox-dropin-btn {
    line-height: 11px !important;
    text-decoration: none !important;
    box-sizing: content-box !important;
      -webkit-box-sizing: content-box !important;
      -moz-box-sizing: content-box !important;
  }
